import React from 'react';
import { Outlet } from 'react-router-dom';
import Sidebar from '../Component'// your reusable Sidebar component

const Layout = () => {
  return (
    <div className='flex h-screen w-screen'>
      <Sidebar />
      <div className='flex-1 bg-[#DAE5F5]'>
        <Outlet />
      </div>
    </div>
  );
};

export default Layout;
